		  370709,"3",26140,NULL,1980,
		  "1.25 USD",36.000,NULL,"It is thought that this issue is the only (first) printing. There exists another printing of issue #3 with a cover price of $2.50 USD and a copyright date of 1989.",
		  NULL,NULL,NULL,NULL,NULL,NULL
		  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
		  370710,"4",26140,NULL,NULL,
		  NULL,NULL,NULL,NULL,
		  NULL,NULL,NULL,NULL,NULL,NULL
		  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
		  370711,NULL,26141,NULL,1968,
		  "0.25 USD",36.000,NULL,"This issue has no Issue Number or Indicia information.Underground Comix are known for using different prices covers (art or color variations) and interior content to distinguish different printings.1st print October 1968 has 0.25 USD cover price. Has single image across pages 10-11.2nd print has 0.25 USD cover price. Image is now printed sideways on page 11. Another image added to page 10.3rd print has 0.25 USD cover price. Page four image now has \"Git Whitey\".In 1972 Print Mint took over production moving the actual printing to a commercial printing plant.4th print June 1972 and 5th print (1973) both have 0.50 USD cover price and said to be indistiguiable from each other.6th print 1973 has 0.75 USD cover price.",
		  NULL,NULL,NULL,NULL,NULL,NULL
		  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
		  370712,"2",26141,NULL,1969,
		  "0.50 USD",36.000,NULL,"Underground Comix are known for using different prices covers (art or color variations) and interior content to distinguish different printings.1st-3rd print have interior color variations.1st print January 1969 has 0.50 USD cover price. Has predominately orange and blue cover.2nd print has 0.50 USD cover price. Has light orange and dark blue cover.3rd print has 0.50 USD cover price. Has light orange and dark blue cover. Interior sequence moved.In 1972 Print Mint took over production moving the actual printing to a commercial printing plant.4th print June 1972 has 0.50 USD cover price. Cover now printed with black ink. Background in circle is blue.5th print 1973 has 0.50 USD cover price. Background in circle is blue. Area under arm is green.6th print 1976 has 0.50 USD cover price. Background in circle is all green.7th print has 0.75 USD cover price. Background circle is green. Area under arm is blue.",
		  NULL,NULL,NULL,NULL,NULL,NULL
		  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
		  370713,"3",26141,NULL,1969,
		  "0.50 USD",36.000,NULL,"Underground Comix are known for using different prices covers (art or color variations) and interior content to distinguish different printings.1st print August 1969 has 0.50 USD cover price. Has rough trimming.In 1972 Print Mint took over production moving the actual printing to a commercial printing plant.2nd print June 1972 has 0.50 USD cover price. No rough triming.3rd print 1973 has 0.50 USD cover price. No rough trimming. Said to be indistinguishable from 2nd print.4th print 1976 has 0.75 USD cover price.Here's one of the rare hand-assembled copies of this notorious comic the last in the short series of three printed by the original publisher Don Donahue. People were supplied with stacks of covers and interior pages and given a stapler and they went at it by hand. The final step in the process was to stack the comics in a paper cutter and trim the edges.  When the books reached the retailer it was common practice to re-sticker the price to 75 cents or more.",
		  NULL,NULL,NULL,NULL,NULL,NULL
		  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
		  370714,"1",26142,2244,1970,
		  "1.00 USD",60.000,NULL,"The indicia title is \"Hydrogen Bomb Funnies.\" The cover title is \"Hydrogen Bomb and Biochemical Warfare Funnies\"1st & 3rd print have 1.00 USD cover price.2nd print has 0.50 USD cover price.",
		  NULL,NULL,NULL,NULL,NULL,NULL
		  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
